import React from "react";
import { Box, Button, Select, MenuItem } from "@material-ui/core";

export default (props) => {
  return (
    <Box>
      <Select>
        <MenuItem value="fullTime">Integral</MenuItem>
        <MenuItem value="partTime">Meio Periodo</MenuItem>
        <MenuItem value="contract">Contrato</MenuItem>
      </Select>
    </Box>
  )
}
